import React, { useState, useEffect, useContext } from 'react';
import { NavLink } from 'react-router-dom';

import { AdminContext } from '../../App';

const Rentcarreports = () => {
    const { adminState, dispatchadmin } = useContext(AdminContext);

    const [incomeByDate, setIncomeByDate] = useState({});

    const getRentCarIncome = async () => {
        try {
            const res = await fetch('/getrentcarincome', {
                method: 'GET'
            });

            const data = await res.json();

            setIncomeByDate(data);
        } catch (error) {
            console.log(error);
        }
    };

    useEffect(() => {
        getRentCarIncome();
    }, []);

    const Loginbutton = () => {
        if (adminState) {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/adminsignout">
                            logout
                        </NavLink>
                    </button>
                </div>
            );
        } else {
            return (
                <div>
                    <button className="logoutbtnDash">
                        <NavLink className="nav-link" to="/signin">
                            login
                        </NavLink>
                    </button>
                </div>
            );
        }
    };

    return (
        <>
            <div className="sidebar">
                {/* Sidebar content */}
            </div>

            <section className="home-section">
                {/* Navigation and profile details */}
                <div className="salecartableDiv">
                    <h1 className="heading">
                        <span>Rented Cars Income Report</span>
                    </h1>

                    <table className="salecartable">
                        <thead>
                            <tr>
                                <th>Date</th>
                                <th>Total Income</th>
                                <th>Sold Items Count</th>
                            </tr>
                        </thead>

                        <tbody>
                            {Object.entries(incomeByDate).map(([date, income]) => (
                                <tr key={date}>
                                    <td>{date}</td>
                                    <td>{income.totalIncome} DA</td>
                                    <td>{income.count}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </section>
        </>
    );
};

export default Rentcarreports;
